import React from "react";
import Star from "../images/star.png"

export default function Cards() {
    return (
        <ul className="cards">
            <li>
                <div className="image"></div>
                <div className="rate">
                    <img className="star" src=""></img>
                </div>
                <div className="name"></div>
                <div className="price"></div>
            </li>
        </ul>
    )
}
